import './App.css';
import stores from './data/stores';
import items from './data/items';

import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';


import Navigation from './components/nav.js';

import HomePage from './pages/HomePage';
import OrderPage from './pages/OrderPage';
import StoresPage from './pages/StoresPage';
import SiteDate from './components/date.js';

function App() {  

  return (
    <div className="App">
      <Router>
      <header>
        <h1>JPM Global</h1>
        <p>
          Promoting Change Worldwide
        </p>
        </header>
        <Navigation/>
        <main>
          <article>
            <Route path="/(|index.html)" exact><HomePage /></Route>
            <Route path="/order"><OrderPage items={items} /></Route>
            <Route path="/stores"><StoresPage stores={stores} /></Route>
          </article>
        </main>
        <footer>
          <p> Modified on <SiteDate/>. <cite>&copy; 2022 Julian MacLeod</cite>. </p>
        </footer>
      </Router>
    </div>
  );
}

export default App;
